(1324, 235, '_elementor_data', '[{\"id\":\"7fd7f4b4\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"64c2322b\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"235647ae\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<!-- wp:image {\\\"id\\\":33,\\\"sizeSlug\\\":\\\"full\\\",\\\"linkDestination\\\":\\\"none\\\"} -->\\n<figure class=\\\"wp-block-image size-full\\\"><img src=\\\"http:\\/\\/localhost:8081\\/wordpress3\\/wp-content\\/uploads\\/2022\\/07\\/pirsing.webp\\\" alt=\\\"\\\" class=\\\"wp-image-33\\\"\\/><figcaption>piersings<\\/figcaption><\\/figure>\\n<!-- \\/wp:image -->\\n\\n<!-- wp:paragraph {\\\"style\\\":{\\\"color\\\":{\\\"text\\\":\\\"#6f6d6d\\\"}}} -->\\n<p class=\\\"has-text-color\\\" style=\\\"color:#6f6d6d\\\"><a href=\\\"https:\\/\\/www.byrdie.com\\/piercing-ideas-4844136\\\">Ear piercings<\\/a>\\u00a0run the gamut from traditional piercings to edgier ones, which is probably why earrings are so popular. An orbital piercing, for example, runs from side to side rather than front to back, with two pierced holes instead of one. Some pierce the cartilage, which may take longer to heal, while others are in the fleshy parts. \\u201cVarious cartilage piercings on the ear, including Daith, snug, helix, and conch, have various healing timeframes and pain thresholds. Generally speaking, [expect about] four to 12 months for healing,\\u201d says Rose.\\u00a0<a href=\\\"https:\\/\\/www.byrdie.com\\/different-type-ear-piercings-4843510\\\">Cartilage piercings<\\/a>\\u00a0are also more prone to infection since cartilage has less blood supply to help fight germs.<\\/p>\\n<!-- \\/wp:paragraph -->\\n\\n<!-- wp:image {\\\"id\\\":34,\\\"width\\\":188,\\\"height\\\":268,\\\"sizeSlug\\\":\\\"full\\\",\\\"linkDestination\\\":\\\"none\\\"} -->\\n<figure class=\\\"wp-block-image size-full is-resized\\\"><img src=\\\"http:\\/\\/localhost:8081\\/wordpress3\\/wp-content\\/uploads\\/2022\\/07\\/pirsing.jpg\\\" alt=\\\"\\\" class=\\\"wp-image-34\\\" width=\\\"188\\\" height=\\\"268\\\"\\/><\\/figure>\\n<!-- \\/wp:image -->\\n\\n<!-- wp:list {\\\"style\\\":{\\\"color\\\":{\\\"text\\\":\\\"#6f6c6c\\\"}},\\\"gradient\\\":\\\"pale-ocean\\\"} -->\\n<ul id=\\\"mntl-sc-block_1-0-11\\\" class=\\\"has-pale-ocean-gradient-background has-text-color has-background\\\" style=\\\"color:#6f6c6c\\\"><li><a href=\\\"https:\\/\\/www.byrdie.com\\/double-ear-piercing-5093746\\\">Lobe (including Orbital)<\\/a>: \\u201cThe earlobe piercing is the easiest piercing to get in terms of pain and healing,\\u201d says Rose. \\u201cIt is with minimal discomfort, and healing can take four to six weeks.\\u201d With that said, Rose does advise against using rubbing alcohol and peroxide, and wearing face masks that go behind your ears. \\u201cThe contact from the masks cause pressure, introduce bacteria, and cause irritation, which interferes with healing,\\u201d she says. \\u201cUse ones that tie around the head, gators, bandanas, or anything other than the strings.\\u201d<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/helix-piercing-5085357\\\">Helix<\\/a>&nbsp;and&nbsp;<a href=\\\"https:\\/\\/www.byrdie.com\\/forward-helix-piercing-5089384\\\">Helix Orbital<\\/a>: Along the curled outer edge of your upper ear cartilage.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/conch-piercing\\\">Conch<\\/a>: The conch is at the large opening of your ear and, it might be one of the riskiest for damage to the cartilage and possible infection.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/daith-piercing\\\">Daith<\\/a>: A cartilage piercing of the innermost cartilage fold.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/rook-piercing\\\">Rook<\\/a>: Along the inner ridge of ear cartilage that runs down the center, parallel to the outer rim.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/tragus-piercing\\\">Tragus and Anti-Tragus<\\/a>: The rounded protuberance of cartilage just outside the ear canal.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/industrial-bar-piercing-5074609\\\">Industrial\\/Scaffold<\\/a>: A two-hole piercing, the jewelry includes a long-spanning bar.<\\/li><li><a href=\\\"https:\\/\\/www.byrdie.com\\/snug-piercing-5076220\\\">Snug\\/Anti-Helix<\\/a>: Along the vertical inner cartilage ridge.<\\/li><\\/ul>\\n<!-- \\/wp:list -->\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"d934d22\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"1a23089\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[],\"isInner\":false},{\"id\":\"a402aec\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[],\"isInner\":false}],\"isInner\":false}]'),
