today – is to offer women across the world a universe of high quality, hand-finished, modern and genuine jewelry products at affordable prices, thereby inspiring women to express their individuality. All women have their individual stories to tell – a personal collection of special moments that makes them who they are. That is why we celebrate these moments. That is why we say these moments are unforgettable.&nbsp;Like the story of Pandora.</p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-07-31 14:02:59', '2022-07-31 14:02:59', '', 13, 'http://localhost:8081/wordpress3/?p=14', 0, 'revision', '', 0),
