(19, 1, '2022-07-31 14:12:46', '2022-07-31 14:12:46', '<!-- wp:image {\"id\":20,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wordpress3/wp-content/uploads/2022/07/white-yellow-gold-rings.webp\" alt=\"\" class=\"wp-image-20\"/><figcaption>white vs yellow</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#787777\"}}} -->\n<p class=\"has-text-color\" style=\"color:#787777\">There are a lot of similarities between white and yellow gold — both work well with nearly any&nbsp;<a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/diamond-cut/\"><u>cut</u></a>,&nbsp;<a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/diamond-clarity/\"><u>clarity</u></a>, and&nbsp;<a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/diamond-carat-weight/\"><u>carat</u></a>&nbsp;of a diamond. The key differences between white,&nbsp;<a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/blog/rose-gold-vs-gold/\"><u>yellow, and rose gold</u></a>&nbsp;are the metal mixtures used to make them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#757272\"}}} -->\n<p class=\"has-text-color\" style=\"color:#757272\">Some of the most common metals mixed with gold are copper, silver, nickel, palladium, and zinc. The three standard colors result from different mixtures of metals. White gold has more nickel and zinc, while yellow gold contains more copper.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Is White Gold Real Gold?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":23,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wordpress3/wp-content/uploads/2022/07/white-gold.webp\" alt=\"\" class=\"wp-image-23\"/><figcaption>White Gold Rings</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6d6d\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6d6d\">White gold is definitely real gold. It simply has a different mixture of other metals in it. White gold also has a special coating on the outside to give it luster and beauty.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6d6d\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6d6d\">White gold is an alloy or combination of gold and another metal — usually nickel, silver, or palladium. These metals are mixed together, and the white gold alloys are then used to make jewelry.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6f6f\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6f6f\">A considerable part of the color variation comes from the metal mixture and the types of metal used. Not all alloy metals are made the same.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Which One Is More Expensive?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6f6f\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6f6f\">For the most part, white gold and yellow gold are equally priced if they have the same pure gold content. Some jewelers charge a bit more for white gold due to the addition of rhodium plating.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6b6b\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6b6b6b\">At Clean Origin, all of the 14k gold rings are priced the same, and the 18k gold rings are priced the same — regardless of the color.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">The History of Gold Yewelry</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":27,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wordpress3/wp-content/uploads/2022/07/yellow-gold-band-wings.webp\" alt=\"\" class=\"wp-image-27\"/><figcaption>Yellow Gold</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6b6b\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6b6b\">The purest form of gold used in jewelry has been dated back to 4000 B.C. It was most notably used during the Georgian and Victorian eras. During these times, gold was a precious metal used in collaboration with other jewels such as rubies and sapphires.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6b6b\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6b6b\">Eventually, jewelers saw the benefit of mixing pure gold with other metals to make jewelry more durable and less expensive.&nbsp;Pure gold mixed with other metals is now standard practice for jewelry.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6b6b\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6b6b\"><a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/blog/yellow-gold-engagement-rings/\"><u>Yellow gold engagement rings</u></a>&nbsp;were trendy in the late 1990s and are coming back with&nbsp;<a target=\"_blank\" rel=\"noreferrer noopener\" href=\"https://www.cleanorigin.com/blog/millennials-choosing-lab-grown-diamonds/\"><u>millennials</u></a>.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6b6b\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6b6b\">White gold was invented in the 19th century but did not become widely popular until the 1920s. Since platinum was for many military purposes, white gold jewelry was an easy and less expensive substitute. It has grown its popularity over the years, with many jewelers offering engagement rings made with this metal.</p>\n<!-- /wp:paragraph -->', 'White Gold vs Yellow Gold: What\'s the Difference?', '', 'publish', 'open', 'open', '', 'white-gold-vs-yellow-gold-whats-the-difference', '', '', '2022-07-31 14:30:52', '2022-07-31 14:30:52', '', 0, 'http://localhost:8081/wordpress3/?p=19', 0, 'post', '', 0),
