erit', 'closed', 'closed', '', '39-revision-v1', '', '', '2022-07-31 16:48:49', '2022-07-31 16:48:49', '', 39, 'http://localhost:8081/wordpress3/?p=44', 0, 'revision', '', 0),
(45, 1, '2022-07-31 17:11:59', '2022-07-31 17:11:59', '<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#676464\"}}} -->\n<p class=\"has-text-color\" style=\"color:#676464\">Diamonds are the world’s most beloved gemstone. Here is a collection of some of the most interesting facts about our all-time favorite gemstone!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":46,\"width\":448,\"height\":269,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-resized\"><img src=\"http://localhost:8081/wordpress3/wp-content/uploads/2022/07/dijamant.jpg\" alt=\"\" class=\"wp-image-46\" width=\"448\" height=\"269\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:list {\"ordered\":true,\"style\":{\"color\":{\"text\":\"#636161\"}}} -->\n<ol class=\"has-text-color\" style=\"color:#636161\"><li>Diamonds are the earth’s hardest natural substance. The only thing that can scratch a diamond is another diamond! </li><li>Diamonds form approximately 100 miles under the earth and are carried to the surface by volcanic activity.</li><li>Diamonds are the only gems made of one element. They are made of pure carbon.</li><li>Diamonds are found in every color of the rainbow. The rarest natural diamond colors are blue, green, orange, and red.</li><li>The word diamond comes from the Greek word “adamas.” It means invincible or indestructible.</li><li>Many ancient cultures had beliefs about diamonds. Some believed diamonds gave their wearers courage and strength in battle.</li><li>In the Middle Ages, many believed diamonds had healing properties.</li><li>In 1905, the world’s largest rough diamond was found. It was named the Cullinan diamond and weighed 3,106 carats! It was later cut into many diamonds (9 large ones and 100 smaller ones).</li><li>Only about 30 percent of diamonds mined around the world are gem quality.</li><li>Before the 18th century, most of the world’s diamonds were found in India.</li><li>The primary diamond source in the world has changed several times. Today, diamonds are found in many countries around the world. </li><li>In 2014, the #1 country for the production of diamonds was Russia.</li><li>The first diamond engagement ring was given to Mary of Burgundy from the Archduke Maximilian of Austria. </li><li>The United States is the world’s largest diamond market.</li><li>In 2004, scientists discovered a planet they believe is at least one-third diamond! It was named “55 Cancri e.”</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:quote {\"align\":\"center\",\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"medium\"} -->\n<blockquote class=\"wp-block-quote has-text-align-center has-cyan-bluish-gray-color has-text-color has-medium-font-size\"><p></p><p><em>Diamonds are a girl’s best friend.</em></p><cite>Marilyn Monroe</cite></blockquote>\n<!-- /wp:quote -->', '15 Interesting Facts About Diamonds', '', 'publish', 'open', 'open', '', '15-interesting-facts-about-diamonds', '', '', '2022-07-31 17:11:59', '2022-07-31 17:11:59', '', 0, 'http://localhost:8081/wordpress3/?p=45', 0, 'post', '', 0),
