iamond source in the world has changed several times. Today, diamonds are found in many countries around the world. </li><li>In 2014, the #1 country for the production of diamonds was Russia.</li><li>The first diamond engagement ring was given to Mary of Burgundy from the Archduke Maximilian of Austria. </li><li>The United States is the world’s largest diamond market.</li><li>In 2004, scientists discovered a planet they believe is at least one-third diamond! It was named “55 Cancri e.”</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:quote {\"align\":\"center\",\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"medium\"} -->\n<blockquote class=\"wp-block-quote has-text-align-center has-cyan-bluish-gray-color has-text-color has-medium-font-size\"><p></p><p><em>Diamonds are a girl’s best friend.</em></p><cite>Marilyn Monroe</cite></blockquote>\n<!-- /wp:quote -->', '15 Interesting Facts About Diamonds', '', 'inherit', 'closed', 'closed', '', '45-revision-v1', '', '', '2022-07-31 17:11:59', '2022-07-31 17:11:59', '', 45, 'http://localhost:8081/wordpress3/?p=47', 0, 'revision', '', 0),
