(121, 1, '2022-08-01 13:09:42', '2022-08-01 13:09:42', '<!-- wp:image {\"id\":37,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:8081/wordpress3/wp-content/uploads/2022/07/horoscope.jpg\" alt=\"\" class=\"wp-image-37\"/><figcaption>gemstone </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Aquarius</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#747474\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#747474\">Amethyst</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6e6969\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6e6969\">Sometimes Aquarians can get lost in the maze of their own thoughts and this can lead to overwhelm. Fortunately, with&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/amethyst-bead-bracelet\" target=\"_blank\">Amethyst&nbsp;</a>on your side, you can stay level-headed, light of heart and ever soaked in spiritual purity. Find out more about&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/amethyst-meaning-healing-properties-and-everyday-uses\" target=\"_blank\">Amethyst\'s meaning</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Pisces</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6e6d6d\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#6e6d6d\">Aquamarine</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6a6a\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6b6a6a\">The water of the sea stone,&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/aquamarine-bracelet\" target=\"_blank\">Aquamarine&nbsp;</a>brings its mermaids treasure traits to the table for Pisces to enjoy. This stone invites the Pisces to tap into their own capabilities and embrace the ebb and flow of life. Find out more about&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/aquamarine-meaning-stone-guide-healing-properties\" target=\"_blank\">Aquamarine meaning</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Aries</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5c5959\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#5c5959\">Diamonds</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#615f5f\"}}} -->\n<p class=\"has-text-color\" style=\"color:#615f5f\">Dreamy in devotion, the Diamond is a strong symbol of light and loyalty which are common traits for an Aries sign. The Diamond has a high frequency and can help with inner vision.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Taurus</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6a6767\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#6a6767\">Emerald</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6a6767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6a6767\">The flash of Emerald is a stone of fortune, love, and endless patience. It is also the stone of Venus, which is the ruling planet of Taurus making it a magical match across all avenues.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Gemini</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#626060\">Agate</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626060\"><a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/brown-agate-bracelet\" target=\"_blank\">Agate&nbsp;</a>has gorgeous heartfelt energy which perfectly matches the Gemini’s joyful moods. Blue Lace Agate can also work wonders on communication, great for the chatty Gemini.&nbsp;Discover more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/agate-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Agate</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Cancer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#737171\"}}} -->\n<p class=\"has-text-color\" style=\"color:#737171\">Moonestone</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646464\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646464\">The mystical light of Moonstone glows with deep creative and feminine vibes, inviting those who fall under the sign of Cancer to stand steady on their feet without letting go of their softness. Find out more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/moonstone-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning behind Moonstone</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Leo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#626060\">Citrine</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626060\">Sweet&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/citrine-bracelet\" target=\"_blank\">Citrine&nbsp;</a>brings joy, warmth, and pure positivity to the table, making it a great pick me up for Leo’s who can sometimes get weighed down. It’s also a stone of prosperity.&nbsp;Find out more about&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/citrine-meaning-healing-properties\" target=\"_blank\">Citrine meaning</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Virgo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6767\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#6b6767\">Blue Saphire</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6b6767\">Wisdom, hope, and faith flow through the ancient gemstone of sparkling Blue Sapphire. For Virgos who tend to overthink and fall into self-criticism, the Sapphire lifts those spirits and keeps the balance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Libra</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#625d5d\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#625d5d\">Opal</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#625d5d\"}}} -->\n<p class=\"has-text-color\" style=\"color:#625d5d\">The ruling birthstone for Libra, the iridescent and playful hues of the Opal invites a positive shine and encourages Librans to step aside from people-pleasing to put their own needs first.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Scorpio</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5c5959\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#5c5959\">Agate</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5c5959\"}}} -->\n<p class=\"has-text-color\" style=\"color:#5c5959\">The Agate family make for a fascinating match for Scorpio. Choose&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/blue-lace-agate-bracelet\" target=\"_blank\">Blue Lace Agate</a>&nbsp;for beautiful communication skills or opt for Moss Agate to mend the energy between Mother Nature and your soul.&nbsp;Discover more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/agate-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Agate</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Sagitarius</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646262\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#646262\">Blue Topaz</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646262\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646262\">Clear out the junk from your aura and let go of all those things that are keeping you off-balance with the clear flow of Blue Topaz. Also known as the communication stone, it’s an awesome gem for writers.&nbsp;Find out more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/bloodstone-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Topaz</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Capricorn</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#706c6c\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#706c6c\">Ruby</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#706c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#706c6c\">A vivacious stone, the Ruby loves to nudge your chi, attract prosperity, and keep you in vital health. The Ruby really matches the ambitious nature shared by Capricorns.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:imagely/nextgen-gallery -->\n[ngg src=\"galleries\" ids=\"5\" display=\"basic_thumbnail\" thumbnail_crop=\"0\"]\n<!-- /wp:imagely/nextgen-gallery -->', 'Zodiac Gemstone Guide', '', 'inherit', 'closed', 'closed', '', '36-revision-v1', '', '', '2022-08-01 13:09:42', '2022-08-01 13:09:42', '', 36, 'http://localhost:8081/wordpress3/?p=121', 0, 'revision', '', 0),
