all avenues.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Gemini</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#626060\">Agate</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626060\"><a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/brown-agate-bracelet\" target=\"_blank\">Agate&nbsp;</a>has gorgeous heartfelt energy which perfectly matches the Gemini’s joyful moods. Blue Lace Agate can also work wonders on communication, great for the chatty Gemini.&nbsp;Discover more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/agate-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Agate</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Cancer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#737171\"}}} -->\n<p class=\"has-text-color\" style=\"color:#737171\">Moonestone</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646464\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646464\">The mystical light of Moonstone glows with deep creative and feminine vibes, inviting those who fall under the sign of Cancer to stand steady on their feet without letting go of their softness. Find out more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/moonstone-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning behind Moonstone</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Leo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#626060\">Citrine</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626060\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626060\">Sweet&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/citrine-bracelet\" target=\"_blank\">Citrine&nbsp;</a>brings joy, warmth, and pure positivity to the table, making it a great pick me up for Leo’s who can sometimes get weighed down. It’s also a stone of prosperity.&nbsp;Find out more about&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/citrine-meaning-healing-properties\" target=\"_blank\">Citrine meaning</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Virgo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6767\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#6b6767\">Blue Saphire</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b6767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6b6767\">Wisdom, hope, and faith flow through the ancient gemstone of sparkling Blue Sapphire. For Virgos who tend to overthink and fall into self-criticism, the Sapphire lifts those spirits and keeps the balance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Libra</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#625d5d\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#625d5d\">Opal</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#625d5d\"}}} -->\n<p class=\"has-text-color\" style=\"color:#625d5d\">The ruling birthstone for Libra, the iridescent and playful hues of the Opal invites a positive shine and encourages Librans to step aside from people-pleasing to put their own needs first.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Scorpio</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5c5959\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#5c5959\">Agate</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5c5959\"}}} -->\n<p class=\"has-text-color\" style=\"color:#5c5959\">The Agate family make for a fascinating match for Scorpio. Choose&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/products/blue-lace-agate-bracelet\" target=\"_blank\">Blue Lace Agate</a>&nbsp;for beautiful communication skills or opt for Moss Agate to mend the energy between Mother Nature and your soul.&nbsp;Discover more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/agate-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Agate</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Sagitarius</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646262\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#646262\">Blue Topaz</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646262\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646262\">Clear out the junk from your aura and let go of all those things that are keeping you off-balance with the clear flow of Blue Topaz. Also known as the communication stone, it’s an awesome gem for writers.&nbsp;Find out more about the&nbsp;<a rel=\"noreferrer noopener\" href=\"https://tinyrituals.co/blogs/tiny-rituals/bloodstone-meaning-healing-properties-everyday-uses\" target=\"_blank\">meaning of Topaz</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"large\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-large-font-size\">Capricorn</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#706c6c\"}},\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size\" style=\"color:#706c6c\">Ruby</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#706c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#706c6c\">A vivacious stone, the Ruby loves to nudge your chi, attract prosperity, and keep you in vital health. The Ruby really matches the ambitious nature shared by Capricorns.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n[foogallery id=\"123\"]\n<!-- /wp:shortcode -->', 'Zodiac Gemstone Guide', '', 'inherit', 'closed', 'closed', '', '36-revision-v1', '', '', '2022-08-01 13:19:15', '2022-08-01 13:19:15', '', 36, 'http://localhost:8081/wordpress3/?p=134', 0, 'revision', '', 0),
(135, 1, '2022-08-01 13:46:07', '2022-08-01 13:46:07', '<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"medium\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-medium-font-size\">How do I track my order?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6c6c\">Once your order has shipped from our warehouse, you will receive an email notification with a tracking information. Please also check your junk email. This email will have all your shipping information and ways to track your order.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6c6c\">Please note you will not get tracking information until your order is processed and shipped. There may be additional shipping delays due to high order volumes.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Order', '', 'publish', 'closed', 'closed', '', 'order', '', '', '2022-08-01 13:46:23', '2022-08-01 13:46:23', '', 0, 'http://localhost:8081/wordpress3/?page_id=135', 0, 'page', '', 0),
(136, 1, '2022-08-01 13:46:07', '2022-08-01 13:46:07', '<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"medium\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-medium-font-size\">How do I track my order?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your order has shipped from our warehouse, you will receive an email notification with a tracking information. Please also check your junk email. This email will have all your shipping information and ways to track your order.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please note you will not get tracking information until your order is processed and shipped. There may be additional shipping delays due to high order volumes.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Order', '', 'inherit', 'closed', 'closed', '', '135-revision-v1', '', '', '2022-08-01 13:46:07', '2022-08-01 13:46:07', '', 135, 'http://localhost:8081/wordpress3/?p=136', 0, 'revision', '', 0),
(137, 1, '2022-08-01 13:46:20', '2022-08-01 13:46:20', '<!-- wp:paragraph {\"textColor\":\"cyan-bluish-gray\",\"fontSize\":\"medium\"} -->\n<p class=\"has-cyan-bluish-gray-color has-text-color has-medium-font-size\">How do I track my order?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6c6c\">Once your order has shipped from our warehouse, you will receive an email notification with a tracking information. Please also check your junk email. This email will have all your shipping information and ways to track your order.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6f6c6c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6f6c6c\">Please note you will not get tracking information until your order is processed and shipped. There may be additional shipping delays due to high order volumes.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Order', '', 'inherit', 'closed', 'closed', '', '135-revision-v1', '', '', '2022-08-01 13:46:20', '2022-08-01 13:46:20', '', 135, 'http://localhost:8081/wordpress3/?p=137', 0, 'revision', '', 0),
(138, 1, '2022-08-01 13:47:40', '2022-08-01 13:47:40', '<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\">Orders ship Monday to Friday excluding US Federal holidays<br><br><strong>Standard</strong>&nbsp;|&nbsp;Free shipping on all orders over $75<br>Estimated delivery within 2-4 business days.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\"><strong>Express Shipping&nbsp;</strong>| $16.95<br>Estimated delivery within 1-2 business days.*</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\"><br>*Orders will arrive in 1-2 days if ordered before 1pm EST Mon-Fri. We do not offer this on weekends.<br>•&nbsp;Deliveries to Alaska, Hawaii and Puerto Rico may be delayed.<br>• Delivery to PO Boxes is not available (although can be used for billing addresses).<br>• Deliveries to APO/FPO addresses are sent via USPS Priority. Due to military handling time, delivery to some destinations may take up to 21 days.<br>•&nbsp;<strong>NOTE&nbsp;</strong>all orders over $300 will require a signature upon delivery.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Shipping', '', 'publish', 'closed', 'closed', '', 'shipping', '', '', '2022-08-01 13:47:42', '2022-08-01 13:47:42', '', 0, 'http://localhost:8081/wordpress3/?page_id=138', 0, 'page', '', 0),
(139, 1, '2022-08-01 13:47:40', '2022-08-01 13:47:40', '<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\">Orders ship Monday to Friday excluding US Federal holidays<br><br><strong>Standard</strong>&nbsp;|&nbsp;Free shipping on all orders over $75<br>Estimated delivery within 2-4 business days.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\"><strong>Express Shipping&nbsp;</strong>| $16.95<br>Estimated delivery within 1-2 business days.*</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#686767\"}}} -->\n<p class=\"has-text-color\" style=\"color:#686767\"><br>*Orders will arrive in 1-2 days if ordered before 1pm EST Mon-Fri. We do not offer this on weekends.<br>•&nbsp;Deliveries to Alaska, Hawaii and Puerto Rico may be delayed.<br>• Delivery to PO Boxes is not available (although can be used for billing addresses).<br>• Deliveries to APO/FPO addresses are sent via USPS Priority. Due to military handling time, delivery to some destinations may take up to 21 days.<br>•&nbsp;<strong>NOTE&nbsp;</strong>all orders over $300 will require a signature upon delivery.&nbsp;</p>\n<!-- /wp:paragraph -->', 'Shipping', '', 'inherit', 'closed', 'closed', '', '138-revision-v1', '', '', '2022-08-01 13:47:40', '2022-08-01 13:47:40', '', 138, 'http://localhost:8081/wordpress3/?p=139', 0, 'revision', '', 0),
(140, 1, '2022-08-01 13:52:30', '2022-08-01 13:52:30', '<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646464\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646464\">Returns by Mail:&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"style\":{\"color\":{\"text\":\"#636262\"}}} -->\n<ul class=\"has-text-color\" style=\"color:#636262\"><li>Complete the Return Form above indicating the quantity, item number and reason code for your return(s).</li><li>Once we receive your return, please allow up to 3 business days for processing. </li><li>All refunds will be issued in the original form of payment. Original shipping charges are not refundable. It can take up to an additional 3 to 5 business days for funds to be credited to your account.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626262\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626262\">Exchanges</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"style\":{\"color\":{\"text\":\"#636363\"}}} -->\n<ul class=\"has-text-color\" style=\"color:#636363\"><li>We do not accept exchanges by mail. If you require an exchange, please return the items by mail or in-store and purchase your desired item(s).</li><li>You may exchange your item(s) at Pandora branded stores for an item of equal or greater value provided it is available. Original shipping costs are non-refundable and therefore not considered for exchanges.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#636363\"}}} -->\n<p class=\"has-text-color\" style=\"color:#636363\">Returns In-Store<br>•Bring original packing slip or email invoice along with merchandise you wish to return to the Pandora store.<br>•Refunds will be processed to the original form of payment. Purchases using PayPal will be issued a gift card.</p>\n<!-- /wp:paragraph -->', 'Return', '', 'publish', 'closed', 'closed', '', 'return', '', '', '2022-08-01 13:52:32', '2022-08-01 13:52:32', '', 0, 'http://localhost:8081/wordpress3/?page_id=140', 0, 'page', '', 0),
(141, 1, '2022-08-01 13:52:30', '2022-08-01 13:52:30', '<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#646464\"}}} -->\n<p class=\"has-text-color\" style=\"color:#646464\">Returns by Mail:&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"style\":{\"color\":{\"text\":\"#636262\"}}} -->\n<ul class=\"has-text-color\" style=\"color:#636262\"><li>Complete the Return Form above indicating the quantity, item number and reason code for your return(s).</li><li>Once we receive your return, please allow up to 3 business days for processing. </li><li>All refunds will be issued in the original form of payment. Original shipping charges are not refundable. It can take up to an additional 3 to 5 business days for funds to be credited to your account.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#626262\"}}} -->\n<p class=\"has-text-color\" style=\"color:#626262\">Exchanges</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"style\":{\"color\":{\"text\":\"#636363\"}}} -->\n<ul class=\"has-text-color\" style=\"color:#636363\"><li>We do not accept exchanges by mail. If you require an exchange, please return the items by mail or in-store and purchase your desired item(s).</li><li>You may exchange your item(s) at Pandora branded stores for an item of equal or greater value provided it is available. Original shipping costs are non-refundable and therefore not considered for exchanges.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#636363\"}}} -->\n<p class=\"has-text-color\" style=\"color:#636363\">Returns In-Store<br>•Bring original packing slip or email invoice along with merchandise you wish to return to the Pandora store.<br>•Refunds will be processed to the original form of payment. Purchases using PayPal will be issued a gift card.</p>\n<!-- /wp:paragraph -->', 'Return', '', 'inherit', 'closed', 'closed', '', '140-revision-v1', '', '', '2022-08-01 13:52:30', '2022-08-01 13:52:30', '', 140, 'http://lo