(170, 1, '2022-08-02 11:01:59', '2022-08-02 11:01:59', 'Izaberi moderan minimalizam u prstenu Svetlucavi preklop. Ovaj ručno završeni prsten sa 14k roze pozlatom odlikuje asimetričan dizajn sa četvrtastim završecima koji se malo preklapaju i daju uglove od 90 stepeni. Spoljni prsten krasi pavé prozirni kockasti cirkon uokviren mikroperlicama, stranice imaju Pandora logo dok su na unutrašnjosti prstena izrezana srca. Na kraju oba profila nalaze se dva monograma Pandora O krune. Suptilno predivan sam po sebi ili upečatljiv kada se kombinuje više komada, ovaj prsten šalje jasnu, šik poruku.', 'Svetlucavi preklop', '<ul>\r\n 	<li>Izuzetan prsten lak za kombinovanje</li>\r\n 	<li>Minimalističkog izgleda</li>\r\n 	<li>Sa cirkonima</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'svetlucavi-preklop', '', '', '2022-08-02 11:01:59', '2022-08-02 11:01:59', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=170', 0, 'product', '', 0),
