(174, 1, '2022-08-02 11:06:42', '2022-08-02 11:06:42', 'Unesi svetlucavost u svoje kombinacije prstenom Nebeska svetlucava zvezda. Inspirisan nebeskom lepotom, elegantan srebrni prsten ima centralni prozirni kockasti cirkon u obliku zvezde i upotpunjen je asimetričnim zvezdicama, dok je u unutrašnjosti prstena ugravirana reč „Dream“. Blistavi komad izgleda predivno i kada se nosi samostalno i u kombinaciji sa Pandora prstenjem od metala drugačijih boja. Klasičan i sofisticiran dodatak svakoj kolekciji.', 'Nebeska svetlucava zvezda', '<ul>\r\n 	<li>Minimalistički dizajn</li>\r\n 	<li>Priroda i nebesko pronstranstvo</li>\r\n 	<li>Nije za priveske</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'nebeska-svetlucava-zvezda', '', '', '2022-09-01 14:58:15', '2022-09-01 14:58:15', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=174', 0, 'product', '', 0),
