(188, 1, '2022-08-02 11:33:04', '2022-08-02 11:33:04', 'Obogati ovu kolekciju klasičnim ogrlicom od karika. Ručno završen sa 14k roze pozlatom, ovaj komad je dostupan u jednoj veličini. Ovu ogrlicu možeš nositi sa jednostavnim minđušama sa 14k roze pozlatom za savremeni izgled u jednoj boji. Ili je kombinuj sa malim, srednjim ili velikim Pandora O privescima i promeni način na koji nosiš svoje omiljene priveske. Ovaj komad možeš da kombinuješ sa različitim teksturama i dužinama za idealnu višeslojnu kombinaciju.', 'Ogrlica od karika', '<ul>\r\n 	<li>14k roze pozlata</li>\r\n 	<li>ogrlica od karika</li>\r\n 	<li>jednostavan dizajn</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'ogrlica-od-karika', '', '', '2022-09-01 14:58:15', '2022-09-01 14:58:15', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=188', 0, 'product', '', 0),
