(196, 1, '2022-08-02 11:38:06', '2022-08-02 11:38:06', 'Sofisticirana i elegantna, ova ogrlica Svetlucave pavé pločice ostavlja bez daha. Ručno završena od srebra, ogrlica ima svetlucave prozirne kockaste cirkone i može da se podesi na tri dužine. Uz kombinaciju pavé i poliranih pločica spojenih većim pojedinačnim kamenčićima između njih, ovaj komad je prva transformacija legendarne Pandora tenis narukvice u ogrlicu. Ovaj komad će promeniti stil svake žene.', 'Svetlucave pavé pločice', '<ul>\r\n 	<li> ogrlica sa privescima</li>\r\n 	<li>srebrna</li>\r\n 	<li>moderan dizajn</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'svetlucave-pave-plocice', '', '', '2022-08-02 16:30:39', '2022-08-02 16:30:39', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=196', 0, 'product', '', 0),
(197, 1, '2022-08-02 11:42:16', '2022-08-02 11:42:16', 'Zahvaljujući ovoj ogrlici Kupolasto zlatno srce, svi pogledi biće uprti u Vas. Ručno završen od srebra, ovaj komad ima privezak u obliku srca sa centrom od 14k zlata, jednostavnog visokog sjaja kojim se postiže suptilan efekat. Ogrlica ima klizeću kopču za podešavanje dužine. Ovaj komad kombinujte sa minđušama u obliku srca za izgled ispunjen ljubavlju prema sebi. Ovim komadom možete i iznenaditi Vama blisku osobu i pokazati joj svoju ljubav.', 'Kupolasto zlatno srce', '<ul>\r\n 	<li>Elegantan dizajn</li>\r\n 	<li>Srednja dužina lanca</li>\r\n 	<li>Kombinacija zlata i srebra</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'kupolasto-zlatno-srce', '', '', '2022-08-02 11:42:16', '2022-08-02 11:42:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=197', 0, 'product', '', 0),
