(201, 1, '2022-08-02 11:49:12', '2022-08-02 11:49:12', 'Viseći privezak Moja lastavica posvećena je tvom slobodnom duhu. Kao simbol slobode i beskrajnih mogućnosti koje nosi budućnost, ovaj srebrni privezak leprša na krilima od briljantnih prozirnih kockastih cirkona. Na prednjoj strani nalazi se lastavica sa svetlucavim pavé, a poleđina je ukrašena srebrnim mikroperlicama. Privezak sa lastavicom je savršen dodatak tvojoj ličnoj kolekciji ili pažljivo odabran poklon za svakog ko tek treba da raširi svoja krila.', 'Moja lastavica', '<ul>\r\n 	<li>privezak sa cirkonima</li>\r\n 	<li>moderan dizajn</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'moja-lastavica', '', '', '2022-09-01 14:58:15', '2022-09-01 14:58:15', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=201', 0, 'product', '', 0),
