(208, 1, '2022-08-02 11:52:47', '2022-08-02 11:52:47', 'Dokažite da Vaša ljubav nema granice visećim priveskom Plavo noćno nebo, polumesec i zvezde. Ručno završen od srebra, prednji viseći deo ima otvoreni krug ukrašen zvezdama koje preklapaju okvir. Zadnji disk odlikuju izdignut kamen u obliku polumeseca, optočen prozirnim kamenčićima i ugravirana poruka „I love you more than all the stars in the sky“. Poklonite ovaj privezak sa mesecom i zvezdama nekoj posebnoj osobi i pokažite joj koliko Vam je stalo.', 'Plavo noćno nebo, polumesec i zvezde', '<ul>\r\n 	<li>privezak sa cirkonima</li>\r\n 	<li>sa ugraviranom porukom</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'plavo-nocno-nebo-polumesec-i-zvezde', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=208', 0, 'product', '', 0),
