(210, 1, '2022-08-02 12:32:25', '2022-08-02 12:32:25', 'Minđuše u koje ćeš se zaljubiti. Izrađene od srebra sa legendarnom Pandora „zmijskom“ teksturom lanca, ove asimetrične minđuše služe kao podsetnik da ljubav ne možeš da staviš u kalup. Nosi ove simbole ljubavi prema sebi samostalno ili im dodaj do tri svoja priveska, viseća priveska i priveska za ogrlice i ispričaj svetu priču o sebi.', 'Alke u obliku srca', '<ul>\r\n 	<li>Alke</li>\r\n 	<li>Moderan dizajn</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'alke-u-obliku-srca', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=210', 0, 'product', '', 0),
