(217, 1, '2022-08-02 12:35:29', '2022-08-02 12:35:29', 'Dodaj dubinu i boju svojim prolećnim kombinacijama našim minđušama Tamnoljubičasta viola. Ukrašena 14 roze pozlatom, svaka viola ima dve latice prekrivene svetlucavim pavé i tri latice sa ručno nanetim emajlom, što svaki cvet čini potpuno jedinstvenim. Najnoviji cvet koji će uneti gracioznost u naš vrt, viola je simbol ljubavi u mnogim njenim oblicima. Nosi ih kao podsetnik na sve ljude u tvom životu koje voliš. Kreiraj odvažan prolećni izgled i kombinuj ih sa našim prstenom Tamnoljubičasta viola.', 'Tamnoljubičasta viola', '<ul>\r\n 	<li>sa cirkonima</li>\r\n 	<li>elegantnog izgleda</li>\r\n 	<li>14k roze pozlata</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'tamnoljubicasta-viola', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=217', 0, 'product', '', 0),
(218, 1, '2022-08-02 12:38:40', '2022-08-02 12:38:40', 'Klasične minđuše Svetlucavi okrugli i četvrtasti visuljci čine kombinaciju četvrtastih i okruglih kockastih cirkona. Ručno završene od srebra, minđuše imaju gornji četvrtasti kamen i tri viseća kamenčića ispod njega. Svetlucave viseće minđuše su klasičnog stila koji će se čuvati godinama zahvaljujući svom sofisticiranom, ali jednostavnom dizajnu. Nosi ih samostalno ili u kombinaciji sa istom ogrlicom za usklađen i elegantan izgled.', 'Svetlucavi okrugli i četvrtasti visuljci', '<ul>\r\n 	<li>elegantan dizajn</li>\r\n 	<li>sa cirkonima</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'svetlucavi-okrugli-i-cetvrtasti-visuljci', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=218', 0, 'product', '', 0),
(219, 1, '2022-08-02 12:45:26', '2022-08-02 12:45:26', 'Naša pletena kožna narukvica dobija novo ruho sa srebrnom T-pločicom koja zatvara narukvicu i ima naš prepoznatljiv dezen zmijskog lanca. Provuci T-pločicu kroz najmanji krug unutar velikog prstena sa teksturom „zmijskog“ da bi kopča narukvice bila čvrsto zatvorena. Pošto je koža prirodni materijal, tokom vremena može doći do normalnog habanja. Na kožnoj narukvici možeš nositi do 9 privezaka da upotpuniš svoju kombinaciju.', 'Kožna narukvica sa T pločicom', '<ul>\r\n 	<li>Crna</li>\r\n 	<li>Jednostavan dizajn</li>\r\n 	<li>Lako se kombinuje</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'kozna-narukvica-sa-t-plocicom', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=219', 0, 'product', '', 0),
