(226, 1, '2022-08-02 12:48:50', '2022-08-02 12:48:50', 'Inspirisana vezom između majke i deteta, Narukvica sa „zmijskom“ teksturom i beskonačnim čvorom ima asimetričan čvor beskonačnosti koji služi kao kopča. Dve ispupčene niti dele narukvicu na tri dela. Ovaj simbol večne ljubavi može da se nosi samostalno ili personalizovano sa jednim priveskom ili visećim priveskom na kopči i 14–16 privezaka, visećih privezaka ili privezaka za ogrlice na ostatku narukvice.', 'Srebrna narukvica sa beskonačnim čvorom', '<ul>\r\n 	<li>Minimalistički dizajn</li>\r\n 	<li>zmijska šara</li>\r\n 	<li>srebro</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'srebrna-narukvica-sa-beskonacnim-cvorom', '', '', '2022-09-01 14:58:16', '2022-09-01 14:58:16', '', 0, 'http://localhost:8081/wordpress3/?post_type=product&#038;p=226', 0, 'product', '', 0),
